import React, { Component } from 'react';
import Layout from './components/layout/Layout';
import Builder from '../containers/Builder/BurgerBuilder';



class App extends Component {
  render() {
    return (
      <div>
        <Layout>
           <BurgerBuilder/>
          
        </Layout>
      </div>
    );
  }
}

export default App;
